import React from "react";
import { Outlet, Link } from "react-router-dom";

const Footer = () => {
  return (
    <div>
      <h4>Footer</h4>
      <nav>
        <Link to="/about">About Us</Link> | <Link to="/">Home</Link>
      </nav>
      <Outlet />
    </div>
  );
};

export default Footer;
